--Log Number (may take several runs to ensure uniqueness)
UPDATE [Application]
SET LogNumber = REPLACE(LogNumber, SUBSTRING(LogNumber, 5, 4), REPLACE(CAST(CAST(ABS(CHECKSUM(NewId())) % 10000 AS int) AS char(4)), ' ', '0'));
--Application title
WITH RandomApp (ApplicationTitle, Ranking) AS
(Select ApplicationTitle, ROW_NUMBER() OVER (ORDER BY NEWID())
FROM [Application])
UPDATE [Application]
SET ApplicationTitle = RandomApp.ApplicationTitle
FROM [Application] INNER JOIN
(Select [Application].ApplicationId, ROW_NUMBER() OVER (ORDER BY [Application].ApplicationId) AS AppRanking
FROM [Application]) RankTable ON [Application].ApplicationId = [RankTable].ApplicationId INNER JOIN
RandomApp ON [RankTable].AppRanking = RandomApp.Ranking;
