--Scores
UPDATE ApplicationWorkflowStepElementContent
SET Score =  CASE WHEN ClientScoringScale.HighValue > ClientScoringScale.LowValue AND ClientScoringScale.ScoreType = 'decimal' THEN ROUND(ABS(CHECKSUM(NewId())) % ClientScoringScale.HighValue + ClientScoringScale.LowValue, 1)
WHEN ClientScoringScale.HighValue < ClientScoringScale.LowValue AND ClientScoringScale.ScoreType = 'decimal' THEN ROUND(ABS(CHECKSUM(NewId())) % ClientScoringScale.LowValue + ClientScoringScale.HighValue, 1)
WHEN ClientScoringScale.HighValue > ClientScoringScale.LowValue THEN CAST(ABS(CHECKSUM(NewId())) % ClientScoringScale.HighValue + ClientScoringScale.LowValue AS int)
ELSE CAST(ABS(CHECKSUM(NewId())) % ClientScoringScale.LowValue + ClientScoringScale.HighValue AS int)
END
FROM ApplicationWorkflowStepElementContent
INNER JOIN ApplicationWorkflowStepElement ON ApplicationWorkflowStepElementContent.ApplicationWorkflowStepElementId = ApplicationWorkflowStepElement.ApplicationWorkflowStepElementId
INNER JOIN ClientScoringScale ON ApplicationWorkflowStepElement.ClientScoringId = ClientScoringScale.ClientScoringId
WHERE Score IS NOT NULL;
